class TimeAgoPipe {
    transform(value) {
        if (value !== null && value !== undefined) {
            const                  then = moment(value);
            const                  diff = moment().diff(then, 'days');
            return diff > 7 ? then.format('DD/MM/YYYY HH:mm') : then.fromNow();
        }
        return '';
    }
}
